(98, 4, 'It has definitely been a boon to the society. Over twenty years ago the only way we had to keep in touch with others was by a mail or phone. We are more accessible to technology now and we can get in touch with any one we want to. This has allowed for people to stay in touch with family, find old friends that they have lost touch with over the years and even network for their business. Without social networking a lot of this may not have been possible. It has surely been of great use.', '2014-02-11 05:04:27', 3.375),
