INSERT INTO `blogissues` (`Id`, `Topic`, `Description`, `ImagePath`, `ShortDescription`) VALUES
(1, 'Hands up if re-targeting advertisements ever caused you to buy anything.', 'Behavioral retargeting is the process of serving advertising to people because their previous behavior indicates an interest in a brand or product but they did not buy it immediately. This is the digital equivalent of the guy in the car showroom who bumps into you in the local bar and resumes his sales pitch irrespective of the fact that you are having a quiet drink with your friends.</br></br> Maybe retargeting makes sense because most people have no short-term memory? I do not need to be reminded by Zappos that a pair of Scarpa Mojitos costs $139. I read that on the site and I have a memory thank you very much. I was interested in the chocolate brown colored ones but not right then and there. I might come back and buy them when I am ready. I really have a tough time envisaging a situation where it would actually change my behavior unless there was some form of incentive used and you know what I think of brands that use bribes to get people to buy them.</br></br>Whoever contributed to the Wikipedia page on <b><font color=”#0099CC”> behavioral retargeting</font></b> clearly does believe in its efficacy. The entry states,</br><i>“Retargeting ad campaigns usually run on lower cost media, which not only increases effectiveness by specifically targeting an interested audience, but also improves the overall ROI of the advertiser.”</i></br></br>The endnote at the end of this statement links through to a sales pdf issued by TVL Media reviewing the process of retargeting (makes you wonder who wrote the Wikipedia entry does it not?). That document does not justify the claim that retargeting improves the overall ROI of the marketer beyond making an unsubstantiated claim that the process can increase conversions by up to 1000%. I do note that the same document states,</br></br><i>“Re-targeting doesn''t work for all advertisers. It seems to work particularly well when a purchase involves higher levels of research and consideration.”</i></br></br>Really?  I can see why it might work for something trivial that might easily be forgotten. Might it not be that actually the retargeting is taking the credit for purchases that would have been made anyway? Maybe it speeds up the purchase process because it provides an easy link back to the selling site?</br></br> As you can tell I am really dubious about the validity of this procedure so I would like to turn this blog post into an informal poll. Please use the comment box to tell me if you have or have not bought a product as a result of re-targeting. If retargeting did cause you to buy something please tell me why. If you know of some valid research that proves the ROI of retargeting I would love to hear about it. Go on, make a believer of me!', 'targeting.jpg', 'Behavioral re-targeting is the process of serving advertising to people because their previous behavior indicates an interest in a brand or product but they did not buy it immediately.This is the digital equivalent of the guy in the car showroom who bumps into you in the local bar and resumes his sales pitch irrespective of the fact.. '),
(2, 'Samsung can’t buy love but maybe it can charge a premium', 'In a recent post on iMedia Connection, Millward Brown Optimor’s Pandora Lycouri and Dmitri Seredenko conclude that Samsung can’t buy love. In <b><font color=”#0099CC”> “Can Samsung Buy Love?” </font></b>they contend that simply outspending Apple is not going to overturn the strong emotional connection with users that Apple has earned through consistent innovation and iconic style. Maybe not, but it might help Samsung charge a price premium over other brands.</br></br>I have recently spent some time exploring how some brands manage to charge a price premium. Premium is the ability to command a price premium in any product category; it is not the same as luxury. Luxury brands practice an extreme form of premium marketing and additionally leverage the power of scarcity. Limited supply helps convey a perception of exclusivity.</br></br>In the course of my exploration, I have spent some time exploring the mobile phone category in the USA using BrandZ data and Euromonitor. Given the fast-paced nature of the market it is the marketing equivalent of studying how fruit flies evolve. Brands enter the market with something new, they evolve to fend off competition and then, like as not, die. Anyone remember Palm? </br></br>The fascinating thing about the entry of the Apple iPhone to the category was the way the brand immediately supported a price premium over the available brands because it was clearly seen to be different from them. Functionally and from a design viewpoint, it was unlike anything else and so it commanded a price point unlike anything else. This was apparent in our data from 2008 onwards even though the brand took a while to establish widespread salience.</br></br>At the time of the iPhone launch, Motorola and Samsung were the two largest brands by market share, but our data suggests that Motorola was more likely to be perceived as different. That, however, did not last long. By 2009, neither brand was perceived to be well-differentiated (Samsung never had been) and Motorola was beginning to suffer. The brand has never really recovered.</br></br> By contrast, Samsung has strengthened its brand significantly since 2009. The launch of the Galaxy in June 2010 was the turning point. The new smartphone challenged people’s perceptions of what Samsung was all about. Since then, the perception that the brand is setting the trends and has something unique to offer has improved each year as new models are introduced. In 2009, Samsung was more meaningful and salient than average. In 2013, it was more meaningful, different and salient.</br></br>The end result is that while Samsung may not quite match Apple for emotional appeal, our Premium score - a measure of the degree to which people believe it is worth paying the price they perceive the brand to charge relative to category alternatives – indicates that the brand is far better positioned to command a price premium than it once was.</br></br>The big question is will Samsung choose to leverage the perception that it has something different to offer into higher pricing or additional volume? What do you think? Please share your thoughts. ', 'img2.jpg', 'In a recent post on iMedia Connection, Millward Brown Optimor’s Pandora Lycouri and Dmitri Seredenko conclude that Samsung can’t buy love. In “Can Samsung Buy Love?” they contend that simply outspending Apple is not going to overturn the strong emotional connection with users that Apple has earned through consistent innovation and iconic style. Maybe not, but...'),
(3, 'One year later, the nexus 7 has gone from the bad to worst tablet I have ever owned!', 'The first time I used a Nexus 7, I was blown away. It was the perfect form factor for Android, and probably the best Android device I had ever used at the time. All for just $200. You simply couldn’t ask for more in a device. One year later, I’m changing my tune. My Nexus 7 is just a shell of its former self, and an embarrassment to Google. </br></br>I don’t remember when it first started happening, but most say it was when Android 4.2 began hitting devices. The new features and changes in Jelly Bean, 4.2, were certainly welcome additions, but my Nexus’ new found love of life in the slow-lane was not. I have not spent a full year using the Nexus 7 as a daily driver, only the last six months. So at first, I didn’t notice just how bad things had gotten. I thought maybe it was an illusion from using so many high-end Android phones.</br></br>Until I started asking around. I can’t find one person who has been using the Nexus 7 for an extended period of time, and hasn’t seen a massive downgrade in performance. Just what kind of downgrade are we talking here? I cannot pick up my Nexus 7 without experiencing problems like a lag of ten seconds, or more, just to rotate the display; touches refusing to acknowledged; stuttering notification panel actions; and unresponsive apps</br></br>I tried the basics at first, like a factory reset. I then moved onto drastic measures, like rooting and installing CyanogenMod 10.1 (which I thought would surely fix everything, since I’ve used faster devices with lesser hardware, and performance problems were merely a lack of software optimization). And nothing seems to work. Using CyanogenMod worked at first, but things have slowed down dramatically again. I’ve tried uninstalling most of my apps. Using replacement launchers. No widgets. Nothing works. And even if any of those things did work, it would still be terrible looking for Google.</br></br>Other companies, take Amazon for example, have seemingly mastered the budget to performance ratio in affordable tablets in no time. It may have taken a couple generations, which is why I still have hope for the successor to the Nexus 7, but even the first generation Kindle Fire stands up better against the Nexus 7. I can only imagine how the latest Galaxy Tab, Kindle Fire HD, or dare I say the more expensive iPad Mini, would completely knock it out of the park.</br></br>I used to love my Nexus 7. I want to love it again. Have you experienced any similar problems with a Nexus 7, or has your experience been the exact opposite?', 'Nexus7.jpg', 'The first time I used a Nexus 7, I was blown away. It was the perfect form factor for Android, and probably the best Android device I had ever used at the time. All for just $200. You simply couldn’t ask for more in a device. One year later, I’m changing my tune. My Nexus 7 is just a shell of its former self, and an embarrassment to Google...'),
(4, 'Social Networking!!', '<p>The biggest gifts that mankind has got is technology and more so, it is the information technology that has brought this world closer. While growth, development and speed of progress have increased due to this, a special bonding is happening between human beings. This is through the social networking. Well, internet has got many social networking sites such as Facebook, Orkut, Twitter etc and this has become the special platform for strangers to become friends or as a powerful tool of communication.</p><p> But here is the big question- is social networking really a boon or bane? especially in the case of students and today''s generation. Yes, there is no doubt that this helps increase your friends circle, the opportunity to interact with different people and make new friends across the world. But many are asking if the social networking sites are indeed being used for such productive reasons. There has been an increasingly disturbing behavior found in students and youngsters after their exposure towards such sites.</p><p>Their interaction with family members, their concentration towards studies, their interest in outdoor activities have come down drastically. Moreover, youngsters are being lured by conmen and other shady individuals through these sites and this is leading to grave risk. A recent incident of an IIM student committing suicide after knowing about her boyfriend through a social networking site is a clear example of how extreme things can become.</p><p>The experts are suggesting that using of social networking is not wrong but the way it is being used is important. Students and youngsters must be given guidance on what should be the dos and dont''s. Also, the students must be educated on the overall developmental activities instead of getting glued to the mobile phones and computers and spending precious time chatting. Students from their end must take initiative to find out how best such sites can be used. So folks, wake up and use technology as a boon and not a bane.</p>', 'socialmedia.jpg', 'The biggest gifts that mankind has got is technology and more so, it is the information technology that has brought this world closer. While growth, development and speed of progress have increased due to this, a special bonding is happening between human beings. This is through the social networking. Well, internet has got many social networking sites such as... '),
(5, 'IPL needs to be banned?', 'While the perception that cricket is a gentleman''s game had received a severe blow way back in 2000, when the Match Fixing scandal had erupted with Hansie Cronje being at the forefront, the recent turn of events have made sure in no uncertain terms, the clean image that the sport enjoyed is bid adieu for good. With the Indian Premier League (IPL) embracing it''s sobriquet of the ''Indian Problem League'', and doing more harm than good for Indian cricket and cricket in general, it is high time that the league is permanently shut and laid to rest.  IPL involves a format that is tailor-made for malpractices in a country that is the epicenter of betting, being organized by a board whose interests lie solely in minting money, Corruption which was destined to happen has now reached its peak. Not only players but also some of the franchise owners are involved in match fixing which creates doubt about the credibility of the IPL. In my opinion IPL has just caused further destruction to the entire system in India and does not really promote sports. Please share your thoughts.', 'IPL.jpg', 'While the perception that cricket is a gentleman''s game had received a severe blow way back in 2000, when the Match Fixing scandal had erupted with Hansie Cronje being at the forefront, the recent turn of events have made sure in no uncertain terms, the clean image that the sport enjoyed is bid adieu for good. With the Indian Premier League (IPL) embracing... '),
(6, 'Library hours needs to be extended to late night??', 'I am planning to take an initiative to get the library hours of our university extended. I have always wanted to stay longer in the university during night and study in its silent and calm environment. I believe night is the best time we can finish all our assignments and study with some concentration during this month of exam. We students who are living an independent life out here will certainly have to manage our time with all other daily work  through the day as well and hence night is the best time I personally can spend on studies. I would like to gather opinions from students from different discipline and hence decided to blog this post. I could only think of advantages from this change. Isn''t this going to help all the students who would like to have extended hours of peaceful studies at the library?', 'library.jpg', 'I am planning to take an initiative to get the library hours of our university extended. I have always wanted to stay longer in the university during night and study in its silent and calm environment. I believe night is the best time we can finish all our assignments and study with some concentration during this month of exam. We students who are living an independent...');
